export default (function(a,b,c,d,e){return {data:{IGgsjCBB8o:{data:{id:944,attributes:{imdbId:"tt1631867",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTc5OTk4MTM3M15BMl5BanBnXkFtZTgwODcxNjg3MDE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.9\u002F10"},{Source:"Rotten Tomatoes",Value:"91%"},{Source:"Metacritic",Value:"71\u002F100"}],item_lang:{data:{id:1607,attributes:{title:"Edge of Tomorrow",plot:"An alien race has hit the Earth in an unrelenting assault, unbeatable by any military unit in the world. Major William Cage (Cruise) is an officer who has never seen a day of combat when he is unceremoniously dropped into what amounts to a suicide mission. Killed within minutes, Cage now finds himself inexplicably thrown into a time loop-forcing him to live out the same brutal combat over and over, fighting and dying again...and again. But with each battle, Cage becomes able to engage the adversaries with increasing skill, alongside Special Forces warrior Rita Vrataski (Blunt). And, as Cage and Vrataski take the fight to the aliens, each repeated encounter gets them one step closer to defeating the enemy!",slug:"edge-of-tomorrow"}}},books:{data:[{id:5612,attributes:{title:"All You Need Is Kill",description:"Conscripted by alien invaders and forced to die on the battlefield, Keiji Kiriya is astonished to find himself alive the next morning and sent out to die again, a cycle he is forced to repeat unendingly before he learns of the existence of a woman soldier who may enable his escape. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fkoktq5j_9AC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2009-07-21",publisher:a,subtitle:a}},{id:5613,attributes:{title:"All you need is kill",description:a,thumbnail:a,authors:[b,"Paweł Dybała","Shin Yasuda",c,e,"Yoshitoshi Abe","Japonica Polonica Fantastica"],firstBook:d,published:"2014-01-01",publisher:a,subtitle:a}},{id:5614,attributes:{title:"All You Need Is Kill Manga 02",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0vmSoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,b,"Ryosuke Takeshi"],firstBook:d,published:"2014-10-13",publisher:a,subtitle:"The Edge of Tomorrow"}},{id:5615,attributes:{title:"All you need is Kill Chapitre 1",description:"L'humanité est engagée dans une guerre sans précédent. Son ennemi : une civilisation extraterrestre connue sous le nom de \"Mimic\", déterminée à exterminer toute vie humaine. Sur l'île de Kotoiushi, armées japonaise et américaine tentent de lutter contre cette invasion de monstres redoutables. Mais parmi tous les soldats, seul le jeune Keiji Kiriya semble revivre indéfiniment la même bataille...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZddEDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,c,e],firstBook:d,published:"2015-01-08",publisher:"Kazé Manga",subtitle:a}},{id:5616,attributes:{title:"All You Need Is Kill tom 01",description:"Kolejny poranek, dzień przed bitwą. I znów. I jeszcze jeden... W niedalekiej przyszłości ludzkość musi stawić czoła inwazji śmiertelnie niebezpiecznych mimików. Keiji Kiriya, młody, niedoświadczony żołnierz, trafia do bazy Kotoiushi na południu Japonii, gdzie z niewiadomych przyczyn wpada w pętlę czasową. Za każdym razem, gdy ginie, wraca do tego samego punktu w czasie. Czy uda mu się przetrwać? Jaką rolę odegra Rita Vrataski, najlepszy żołnierz w dziejach ludzkości? Ile jeszcze razy przyjdzie Keijiemu przeżyć własną śmierć?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KWwREAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,c],firstBook:d,published:"1000-01-01",publisher:"J.P. Fantastica",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940960672}}("","Hiroshi Sakurazaka","Takeshi Obata",null,"Ryosuke Takeuchi"))